import React from 'react';

import './Story.css';

const Story = ({ story, columns }) => {
    const { title, url, author, num_comments, points } = story;
    return (
        <div className="story" style={{ width: columns.title.width }} >
            <span>
                <a href={url}>{title}</a>
            </span>
            <span style={{ width: columns.author.width }}>
                {author}
            </span>
            <span style={{ width: columns.comments.width }} >
                {num_comments}
            </span>
            <span style={{ width: columns.points.width }}>
                {points}
            </span>
        </div>
    );
}

export default Story;
